import React, { Component } from 'react'

export default class AddTrainer extends Component {
    constructor(props){
        super(props)

        this.state = {
            trainer_id : this.props.match.params.trainer_id,
            firstName : '',
            lastName : '',
            age : 0,
            gender : '',
            certificate : ''
        }
    }
  render() {
    return (
      <div>AddTrainer</div>
    )
  }
}
